import React, { Component } from 'react'

export default class NowPlaying extends Component {
    constructor(props) {
        super(props);
        this.state = {
            playbackState: {}
        }

    }

    componentDidMount() {
        this.props.getPlayback()
        .then(result => {
            this.setState({playbackState: result});
        });
    }

    render() {

        return (
            <div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}>#NP:</div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}>{this.state.playbackState.item}</div>
            </div>
        )
    }
}
